import React,{Component} from "react";
import Children from "./Children";
import "./App.css"

class App extends Component {
  constructor(){
    super();

  }  
  render(){
    var arr = [];
    for(let i=0 ; i<=30 ; i++){
      arr[i] = i;
    }

    return (
      <div className="App">
        {<Children num={i}/>}
      </div>
    );
  }
}

export default App;
